import React from "react";
import { Routes, Route, Navigate } from "react-router-dom";

import Dashboard from "./Dashboard"; // Initial landing dashboard
import Login from "./Login";
import Signup from "./Signup";
import PersonalizedDashboard from "./PersonalizedDashboard"; // After login
import ProtectedRoute from "./ProtectedRoute";

function App() {
  return (
    <Routes>
      {/* Unprotected public landing dashboard */}
      <Route path="/" element={<Dashboard />} />

      {/* Authentication */}
      <Route path="/login" element={<Login />} />
      <Route path="/signup" element={<Signup />} />

      {/* Protected personalized user dashboard */}
      <Route
        path="/personalized-dashboard"
        element={
          <ProtectedRoute>
            <PersonalizedDashboard />
          </ProtectedRoute>
        }
      />

      {/* Redirect unknown routes */}
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>
  );
}

export default App;
